class Solution:
    def longestWord(self, words):
        wordset = set(words)
        words.sort(key=lambda w:(-len(w),w))
        for word in words:
            if all(word[:k] in wordset for k in range(1, len(word))):
                return word
        return ""

import unittest
class test_solution(unittest.TestCase):
    def test_all(self):
        s = Solution()
        i = ["w","wo","wor","worl", "world"]
        self.assertEqual(s.longestWord(i), "world")
        i = ["a", "banana", "app", "appl", "ap", "apply", "apple"]
        self.assertEqual(s.longestWord(i), "apple")
        i = ["yo","ew","fc","zrc","yodn","fcm","qm","qmo","fcmz","z","ewq","yod","ewqz","y"]
        self.assertEqual(s.longestWord(i), "yodn")
        i = ["m","mo","moc","moch","mocha","l","la","lat","latt","latte","c","ca","cat"]
